import React, { useEffect, useState } from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('http://localhost:3000/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json',
      },
      body: JSON.stringify({
        query: `
          query {
            data {
              id
              nb_block
              starknet_block
              eventCount
            }
          }
        `
      })
    })
    .then(r => r.json())
    .then(data => {
      console.log('API response:', data); // Etape 4: Vérifiez la réponse de l'API
      data.data.sort((a, b) => b.id - a.id);
      setData(data.data.data);
    })
    .catch(error => console.error('Error fetching data:', error)); // Etape 3: Gérez les erreurs
  }, []);

  if (!data) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      {data.map(d => (
        <div key={d.id}>
          <p>Block Number: {d.nb_block}</p>
          <p>Starknet Block: {d.starknet_block}</p>
          <p>Event Count: {d.eventCount}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
